import { useState } from "react";
import BlogList from "./BlogList";

const Home = () => {
  const [blogs, setBlogs] = useState([
    { title: 'Serverless application', body: 'lorem ipsum...', author: 'aws', id: 1 },
    { title: 'Dataware housing ', body: 'lorem ipsum...', author: 'gcp', id: 2 },
    { title: 'Web dev top tips', body: 'lorem ipsum...', author: 'azure', id: 3 },
    { title: 'Web dev top tips', body: 'lorem ipsum...', author: 'Snowflake', id: 3 },
    { title: 'Web dev top tips', body: 'lorem ipsum...', author: 'ELK Stack', id: 3 },
    { title: 'Microservices', body: 'lorem ipsum...', author: 'Java', id: 3 },
    { title: 'AL/ML', body: 'lorem ipsum...', author: 'AI', id: 3 }
  ])

  return (
    <div className="home">
      <BlogList blogs={blogs.filter(blog => blog.author === 'aws')} title="Amazon Web Services" />
      <BlogList blogs={blogs.filter(blog => blog.author === 'azure')} title="Microsoft Azure" />
      <BlogList blogs={blogs.filter(blog => blog.author === 'gcp')} title="Google Cloud Platform" />
      <BlogList blogs={blogs.filter(blog => blog.author === 'Snowflake')} title="Snowflake" />
      <BlogList blogs={blogs.filter(blog => blog.author === 'ELK Stack')} title="Elastic Search, Logestic, Kibana" />
      <BlogList blogs={blogs.filter(blog => blog.author === 'Java')} title="Microservices Development" />
      <BlogList blogs={blogs.filter(blog => blog.author === 'AI')} title="Artificial Inteligent / Machine Learning" />
    </div>
  );
}

export default Home;
